pragma solidity 0.7.2;
import "./Ownable.sol";
import "./provableAPI.sol";
contract RandomP2 is Ownable, usingProvable{
    uint256 constant NUM_RANDOM_BYTES_REQUESTED = 1;
    uint256 public latestNumber;

    event LogNewProvableQuery(string description);
    event generatedRandomNumber(uint256 randomNumber);

    constructor() public {
        update();
    }

    function __callback(bytes32 _queryId, string memory _result, bytes memory _proof) public override{
        require(msg.sender == provable_cbAddress());

        uint256 randomNumber = uint256(keccak256(abi.encodePacked(_result))) % 2;
        latestNumber = randomNumber;
        emit generatedRandomNumber(randomNumber);
    }

    function update() payable public {
        uint256 QUERY_EXECUTION_DELAY = 0;
        uint256 GAS_FOR_CALLBACK = 20000000000;
        provable_newRandomDSQuery(
            QUERY_EXECUTION_DELAY,
            NUM_RANDOM_BYTES_REQUESTED,
            GAS_FOR_CALLBACK
        );
        emit LogNewProvableQuery("Provable query was sent, standing by for the answer");
    }

    event wager(address user, uint amount, bool);
    event funded(address owner, uint funding);

    modifier costs(uint cost){
        require(msg.value >= cost);
        _;
    }

    function fundContract() public payable costs(0.00001 ether) returns(uint) {
        require(msg.value != 0);

        emit funded(msg.sender, msg.value);
        return msg.value;
    }

    function placeBet() public payable costs(0.001 ether) returns (bool){
        require(address(this).balance >= msg.value * 2, "Not enough funds in the contract");

        bool result;

        if((block.timestamp % 2) == 0) {
            result = true;
        }else if(block.timestamp % 2 == 1) {
            result = false;
        }
        emit wager(msg.sender, msg.value, result);
        if(result == true){
            msg.sender.transfer(msg.value * 2);
        }else {
        }
        emit wager(msg.sender, msg.value, result);
        return result;
    }

    function getBalance() public returns (uint) {
        return address(this).balance;
    }


    function withdrawBalance() public onlyOwner returns (uint) {
        msg.sender.transfer(address(this).balance);
        assert(address(this).balance == 0);
        return address(this).balance;
    }
}
